import React from 'react';
import "../App.css";

function Login() {
  return (
    <div className="login-container">
      <h1>Login TITE KO MALAKI</h1>
      <h1>BURAT</h1>
      <img 
        src="https://m.media-amazon.com/images/M/MV5BZDE2ZjIxYzUtZTJjYS00OWQ0LTk2NGEtMDliYmI3MzMwYjhkXkEyXkFqcGdeQWFsZWxvZw@@._V1_.jpg"  style={{width:"1000px", height:"1000px"}}/>
    </div>
  );
}

export default Login;
